import React from 'react';

const Dashboard = () => {
  return (
    <div>
        <div className="flex flex-col flex-grow items-center gap-5">
          <img
            src="https://via.placeholder.com/40"
            alt="User Avatar"
            className="h-24 w-24 rounded-full"
          />
          <span>Name</span>

        </div>
    </div>
  )
};

export default Dashboard;
